Domenica insieme al Sottosegretario al Ministero delle Politiche Agricole @giamma71 saremo a #Savigliano, #Mondoví e a #Cuneo, per incontrare cittadini e imprese e discutere di problematiche e soluzioni per il comparto agricolo.
Vi aspettiamo!
@LegaSalvini https://t.co/GbQbjJGCf5

Il cuneo fiscale va affrontato senza mettere datori di lavoro contro lavoratori: 
1) soldi ai lavoratori, senza alzare il costo aziendale per il datore di lavoro;
2) contratti flessibili, produttivitá non gravata da tasse e meno tutele per lavoratori assenteisti.

